script: |
  super -f text -I q13394.spq | sort > q13394.out

inputs:
  - name: q13394.spq
    data: |
      SELECT + - col2 FROM tab0 (FORMAT parquet) WHERE NOT + - col2 * + + col1 + - + ( col1 ) - 83 - col1 + col2 * col2 BETWEEN + col0 * - col1 AND col0 * col0 + - col0 + - 9 / - - 13;
  - name: tab0

outputs:
  - name: q13394.out
    data: |
      -47
      -99
